import React, { Component } from 'react';

export default class Repo extends Component {

  render() {
    const {data} = this.props
    return (
      <div style={{ border: '3px red solid' }}>

        <tr>
          <td></td>
        {data.id}
          </tr>
          <tr>
            {data.title}
          </tr>
      </div>
    );
  }
}
